import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Layout from './components/Layout';
import Home from './pages/Home';
import About from './pages/About';
import Benefits from './pages/Benefits';
import UserTypeSelection from './pages/UserTypeSelection';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import UserTypeLayout from './components/UserTypeLayouts/UserTypeLayout';

function App() {
  return (
    <Router>
      <Routes>
        {/* Public routes with layout */}
        <Route path="/" element={<Layout><Home /></Layout>} />
        <Route path="/about" element={<Layout><About /></Layout>} />
        <Route path="/benefits" element={<Layout><Benefits /></Layout>} />
        <Route path="/user-type" element={<Layout><UserTypeSelection /></Layout>} />
        <Route path="/login/:userType" element={<Layout><Login /></Layout>} />
        <Route path="/register/:userType" element={<Layout><Register /></Layout>} />
        
        {/* Protected routes with user type specific layout */}
        <Route path="/dashboard/:userType" element={<UserTypeLayout />} />
        
        {/* Redirect to home for any unknown routes */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
}

export default App;
